import './Promo.css'
import React from 'react'

function Promo() {

    return (
        <section className="promo">
            <h1 className="promo__title">Учебный проект студента факультета Веб-разработки.</h1>
            <div className="promo__logo"></div>
        </section>

    )
}

export default Promo;
